propDescriptions.onChange:
Callback fired when a menu item is selected.

@param {object} event The event source of the callback.
You can pull out the new value by accessing <code>event.target.value</code> (any).
@param {object} [child] The react element that was selected when <code>native</code> is <code>false</code> (default).

propDescriptions.onClose:
Callback fired when the component requests to be closed.
Use in controlled mode (see open).

@param {object} event The event source of the callback.

propDescriptions.onOpen:
Callback fired when the component requests to be opened.
Use in controlled mode (see open).

@param {object} event The event source of the callback.

propDescriptions.renderValue:
Render the selected value.
You can only use it when the <code>native</code> prop is <code>false</code> (default).

@param {any} value The <code>value</code> provided to the component.
@returns {ReactNode}
